/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER AFTER_UPDATE_ASSET
AFTER UPDATE ON ASSET
FOR EACH ROW
BEGIN 
	DECLARE IS_COMPUTER INT;
    DECLARE COMP_ID INT;
    
    SELECT ID, COUNT(ASSET_KEY)
    INTO COMP_ID, IS_COMPUTER
    FROM COMPUTER
    WHERE ASSET_KEY = NEW.ASSET_KEY;
    
    IF IS_COMPUTER > 0 THEN
		UPDATE COMPUTER_COMPONENT
        SET LOCATION_ID = NEW.LOCATION_ID
        WHERE COMPUTER_ID = COMP_ID
        AND LOCATION_ID IS NOT NULL
        AND `STATUS` = 1
        AND LOCATION_ID = OLD.LOCATION_ID;

        UPDATE COMPUTER_COMPONENT
        SET POSITION = NEW.POSITION
        WHERE COMPUTER_ID = COMP_ID
        AND POSITION IS NOT NULL
        AND `STATUS` = 1
        AND POSITION = OLD.POSITION;
    END IF;
END */;;
