CREATE DEFINER=`root`@`localhost` FUNCTION `GET_TOTAL_CAPACITY`(COMP_ID INT, CASE_COMP VARCHAR(50)) RETURNS varchar(10) CHARSET latin1
BEGIN
	DECLARE TOTAL_CAPACITY INT;
    DECLARE CHAR_CAPACITY VARCHAR(10);
    
    SELECT SUM(CAPACITY)
    INTO TOTAL_CAPACITY
	FROM CASE_COMPONENT
	WHERE CAPACITY IS NOT NULL
	AND NAME = CASE_COMP
	AND CASE_ID = (
		SELECT ID
		FROM COMPUTER_COMPONENT
		WHERE COMPUTER_ID = COMP_ID
		AND IS_CASE = 1
	);
	
    IF TOTAL_CAPACITY >= 1000 THEN
		SET CHAR_CAPACITY = CONCAT(CAST(ROUND(TOTAL_CAPACITY / 1000, 2) AS CHAR),' TB');
    ELSE
		SET CHAR_CAPACITY = CONCAT(CAST(TOTAL_CAPACITY AS CHAR),' GB');
    END IF;
    
    RETURN CHAR_CAPACITY;
    
END ;;
